import React from 'react';

const EmailLink = ({ email }) => {
  const handleClick = () => {
    const mailtoLink = `mailto:${email}`;
    window.location.href = mailtoLink;
  };

  return (
    <a href={`mailto:${email}`} onClick={handleClick}>
      {email}
    </a>
  );
};

export default EmailLink;
